package com.base.project.main;import android.os.Bundle;import android.support.annotation.Nullable;import android.widget.Button;import com.alibaba.android.arouter.facade.annotation.Route;import com.alibaba.android.arouter.launcher.ARouter;import com.base.project.R;import com.base.project.di.component.DaggerActivityComponent;import com.base.project.di.module.ActivityModule;import butterknife.BindView;import butterknife.OnClick;import me.csxiong.library.base.APP;import me.csxiong.library.base.MVPActivity;@Route(path = "/main/toMain")public class MainActivity extends MVPActivity<MainPresenter> implements MainContract.View {    @BindView(R.id.btn_open)    Button mBtn;    @Override    public void initInject() {        DaggerActivityComponent.builder()                .activityModule(new ActivityModule(this))                .appComponent(APP.getInstance().getAppComponent())                .build()                .inject(this);    }    @OnClick(R.id.btn_open)    public void onOpen() {        ARouter.getInstance().build("/multi/test")                .navigation();    }    @Override    public int getLayoutResId() {        return R.layout.activity_main;    }    @Override    public void initUI(@Nullable Bundle savedInstanceState) {    }    @Override    public void initData(@Nullable Bundle savedInstanceState) {    }}